import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { Observable } from 'rxjs';
import { Manager } from '../Model/Manager';

@Injectable({
  providedIn: 'root'
})
export class UserService {
  backendHost:String=""

  constructor(private http:HttpClient) { }
  public getuser():Observable<Array<Manager>>{
    return this.http.get<Array<Manager>>("http://localhost:8085/consultants")
  }
  public searchuser(keyword : string):Observable<Array<Manager>>{
    return this.http.get<Array<Manager>>("http://localhost:8085/consultants/search?keyword="+keyword)
  }
}
